BRUSSELS, Nov 20 (APP): Pakistan’s ambassdor to Belgium, Amna Baloch on Monday met envoy of Oman, Rua Issa Ashraf Alzadjali in Brussels and discussed expanding the scope of bilateral relations between their countries.
The two sides reaffirmed the bonds of friendship and commitment to enhance cooperation, said a post by Pakistan’s embassy in Brussels on social media platform, X.
